r": "#009bedff"}, "degree_centrality": "18.0", "font": {"size": 9}, "id": "n10", "label": "Nitrosomonas", "labels": ":Genus", "metabolic_cluster": "114", "name": "Nitrosomonas", "pagerank_centrality": "1.2540224852000383", "propertyValue": "[\u0027has_rank NCBITaxon:genus\u0027]", "shape": "dot", "size": 13, "synonym": "Unknown", "xref": "[\u0027GC_ID:11\u0027]"}, {"betweenness_centrality": "6187.397906429742", "border-color": "#76d30aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "BiologicalProcess", "closeness_centrality": "0.27069486404833837", "color": {"background": "#cdfb98ff", "border": "#76d30aff"}, "degree_centrality": "28.0", "description": "A trophic process during which a living entity generates food from abiotic sources or through consumption of living or dead material, and captures energy from preformed molecules. Autotrophs are able to fix CO2 as a carbon source for growth. Important examples in wastewater treatment include nitrite and ammonia oxidizers (NOB and AOB), anaerobic ammonia oxidizers (anammox). Mixotrophs can obtain carbon by fixing CO2 and or from organic sources (heterotrophy). The criterium for this MiDAS field is the potential for CO2 fixation i.e. organisms possessing the Calvin-cycle.", "font": {"size": 9}, "id": "n544", "iri": "http://purl.obolibrary.org/obo/ECOCORE_00000163", "label": "Chemotrophy", "labels": ":BiologicalProcess", "metabolic_cluster": "78", "name": "Chemotrophy", "pagerank_centrality": "1.34546074033267", "providedBy": "MiDAS|KG-Microbe", "shape": "dot", "size": 15, "synonym": "", "xref": ""}, {"betweenness_centrality": "17721.11500321186", "border-color": "#76d30aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "BiologicalProcess", "closeness_centrality": "0.29176164115923153", "color": {"background": "#cdfb98ff", "border": "#76d30aff"}, "degree_centrality": "70.0", "description": "The reduction of nitrate to dinitrogen by four reactions; each intermediate is transformed to the next lower oxidation state; also part of cellular bioenergetics; the nitrogen compounds can serve as terminal acceptors for electron transport phosphorylation in place of oxygen. The denitrifiers are usually facultative-anaerobic heterotrophic organisms utilizing nitrate and/or nitrite as electron acceptors in the absence of oxygen. Denitrification is the final step of nitrogen removal from wastewater and generally occurs under anaerobic conditions. Nitrate is available from the oxidation of ammonia by the aerobic activities of the nitrifiers (AOB and NOB). Denitrification involves the sequential reduction of nitrate to inert dinitrogen gas, via several intermediates (nitrite, nitric oxide (gas) and nitrous oxide (gas)). Not all organisms involved in denitrification possess all the genes for reduction of nitrate all the way to dinitrogen gas. As such, for MiDAS profiles, the nitrite reducing organisms are selected to represent the denitrifiers; given denitrification is defined as \u201cthe dissimilatory transformation of nitrate or nitrite to a gas species concomitant with energy conservation\u201d and not all organisms capable of nitrate reduction can reduce nitrite.", "font": {"size": 9}, "id": "n540", "iri": "http://purl.obolibrary.org/obo/GO_0019333", "label": "Denitrification pathway", "labels": ":BiologicalProcess", "metabolic_cluster": "114", "name": "Denitrification pathway", "pagerank_centrality": "2.5029258657669415", "providedBy": "MiDAS|KG-Microbe", "shape": "dot", "size": 24, "synonym": "", "xref": ""}, {"betweenness_centrality": "115.30617143765645", "border-color": "#76d30aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "BiologicalProcess", "closeness_centrality": "0.2216176106851348", "color": {"background": "#cdfb98ff", "border": "#76d30aff"}, "degree_centrality": "8.0", "description": "The process in which a multicellular organism, a unicellular organism or a group of unicellular organisms grow in a threadlike, filamentous shape. Excessive growth of organisms with a filamentous morphology has long been associated with the operational problem of bulking. In this condition, interfloc bridging by the filaments impedes adequate settling of the biomass, resulting in loss of solids with the treated effluent", "font": {"size": 9}, "id": "n940", "iri": "http://purl.obolibrary.org/obo/GO_0030447 ", "label": "Filamentous growth", "labels": ":BiologicalProcess", "metabolic_cluster": "114", "name": "Filamentous growth", "pagerank_centrality": "0.6268255335585204", "providedBy": "MiDAS", "shape": "dot", "size": 10, "synonym": "", "xref": ""}, {"betweenness_centrality": "0.0", "border-color": "#76d30aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "BiologicalProcess", "closeness_centrality": "0.2041002277904328", "color": {"background": "#cdfb98ff", "border": "#76d30aff"}, "degree_centrality": "2.0", "description": "The nitrite oxidizing bacteria are chemolithotrophic organisms, which utilize nitrite as an energy source and. Nitrite oxidation to nitrate is coupled to the reduction of O2. Nitrite is obtained from the activities of the ammonia oxidizing bacteria.", "font": {"size": 9}, "id": "n933", "iri": "http://purl.obolibrary.org/obo/OMIT_0027217", "label": "Nitrification", "labels": ":BiologicalProcess", "metabolic_cluster": "114", "name": "Nitrification", "pagerank_centrality": "0.2677157693518435", "providedBy": "MiDAS", "shape": "dot", "size": 10, "synonym": "", "xref": ""}, {"betweenness_centrality": "902.2768851457427", "border-color": "#31c17aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "OrganismTaxon", "closeness_centrality": "0.20905272981801212", "color": {"background": "#2793146b", "border": "#31c17aff"}, "degree_centrality": "4.0", "font": {"size": 9}, "id": "n795", "label": "Nitrosomonadaceae", "labels": ":Family", "name": "Nitrosomonadaceae", "pagerank_centrality": "0.5175296824050096", "propertyValue": "[\u0027has_rank NCBITaxon:family\u0027]", "shape": "dot", "siz compounds. These organisms utilize sulfate as a terminal electron acceptor producing hydrogen sulfide. A variety of sulfate reducers have been described, being able to degrade a range of organic compounds to acetate or completely to CO2. A variety of alternate electron acceptors have also been demonstrated, including Fe(III), nitrate and organics (fermentation). Therefore, a high abundance does not always reflect high levels of sulfate reduction. They are thought not to degrade complex polymers and rely on the activities of the hydrolysers and fermenters for a supply of carbon. The abundance and activity of these organisms is not favorable in wastewater treatment and anaerobic digestion as they compete with the methanogens for substrate, giving a lower methane yield, and hydrogen sulfide is toxic, odorous and associated with bio-corrosion problems in sewer systems and treatment facilities.", "font": {"size": 9}, "id": "n541", "iri": "http://purl.obolibrary.org/obo/GO_0000103", "label": "Sulfate assimilation", "labels": ":BiologicalProcess", "metabolic_cluster": "114", "name": "Sulfate assimilation", "pagerank_centrality": "1.3140086272151603", "providedBy": "MiDAS|KG-Microbe", "shape": "dot", "size": 12, "synonym": "sulphate assimilation|sulfate assimilation|phosphoadenylyl sulfate reduction by an oxidoreductase|acting on sulfur group of donors|NAD or NADP as acceptor|sulphate assimilation|phosphoadenylyl sulphate reduction by an oxidoreductase|acting on sulphur group of donors|NAD or NADP as acceptor", "xref": ""}, {"betweenness_centrality": "2092.5998088813953", "border-color": "#31c17aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "OrganismTaxon", "closeness_centrality": "0.20949263502454993", "color": {"background": "#2793146b", "border": "#31c17aff"}, "degree_centrality": "8.0", "font": {"size": 9}, "id": "n814", "label": "Syntrophobacteraceae", "labels": ":Family", "name": "Syntrophobacteraceae", "pagerank_centrality": "0.8061998078760979", "pr dff"}, "degree_centrality": "24.0", "font": {"size": 9}, "id": "n49", "label": "Ruminococcus", "labels": ":Genus", "metabolic_cluster": "114", "name": "Ruminococcus", "pagerank_centrality": "1.4013607614173558", "propertyValue": "[\u0027has_rank NCBITaxon:genus\u0027]", "shape": "dot", "size": 11, "synonym": "Unknown", "xref": "[\u0027GC_ID:11\u0027]"}, {"betweenness_centrality": "217.86533206001948", "border-color": "#76d30aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "BiologicalProcess", "closeness_centrality": "0.23104693140794225", "color": {"background": "#cdfb98ff", "border": "#76d30aff"}, "degree_centrality": "6.0", "description": "The chemical reactions and pathways resulting in the formation of acetate, the anion of acetic acid. Acetogenesis is routinely applied to broadly describe the biological synthesis of acetate. However, this definition is somewhat misleading as several metabolic strategies result in acetate production. MiDAS therefore applies the strict microbiological definition. True acetogens employ the reductive acetyl-CoA pathway for the synthesis of acetyl-CoA that can be converted to acetate or utilized as a source of carbon for biomass production. In this pathway, hydrogen and CO2 are utilized as an electron donor and acceptor, respectively. Acetogens often utilize alternative donors and acceptors to supplement or replace the use of the pathway for energy or carbon supply depending on growth conditions. Commonly, the pathway operates in conjunction with fermentative pathways, operating to replace generated reducing equivalents in the reduction of CO2. Importantly, organisms possessing the reductive acetyl-CoA pathway can reverse the pathway to oxidize acetate to CO2\u00a0and H2 in concert with hydrogenotrophic methanogens. This is known as syntrophic acetate oxidation (SAO) as it requires the methanogens to remove H2 to make the pathway thermodynamically favorable.", "font": {"size": 9}, "id": "n547", "iri": "http://purl.obo  biomass from the aerobic tank leads to net P removal from the system. Earlier definitions of the PAO included cycling of glycogen and polyhydroxyalkanoates (PHAs) in accordance with the model PAO, Candidatus Accumulibacter. However, the Tetrasphaera do not accumulate PHA or cycle glycogen in the same way. As such, in MiDAS, the cycling of excess polyphosphate under the dynamic conditions of EBPR is applied to define a PAO.", "font": {"size": 9}, "id": "n935", "iri": "http://purl.obolibrary.org/obo/GO_0006799 ", "label": "Polyphosphate biosynthetic process", "labels": ":BiologicalProcess", "metabolic_cluster": "114", "name": "Polyphosphate biosynthetic process", "pagerank_centrality": "0.2675247210747709", "providedBy": "MiDAS", "shape": "dot", "size": 10, "synonym": "polyphosphate anabolism|polyphosphate biosynthesis|polyphosphate formation|polyphosphate synthesis", "xref": ""}, {"betweenness_centrality": "1489.5976596173562", "border-color": "#31c17aff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "OrganismTaxon", "closeness_centrality": "0.21700169532574473", "color": {"background": "#2793146b", "border": "#31c17aff"}, "degree_centrality": "6.0", "font": {"size": 9}, "id": "n866", "label": "Paracoccaceae", "labels": ":Family", "name": "Paracoccaceae", "pagerank_centrality": "0.6669248985069772", "propertyValue": "[\u0027has_rank NCBITaxon:family\u0027]", "shape": "dot", "size": 11, "synonym": "[\u0027\"alpha-3 proteobacteria\" RELATED synonym []\u0027, \u0027\"Rhodobacter clade\" RELATED synonym []\u0027, \u0027\"Rhodobacteraceae\" RELATED synonym []\u0027, \u0027\"Rhodobacteraceae Garrity et al. 2006\" RELATED synonym []\u0027]", "xref": "[\u0027GC_ID:11\u0027, \u0027PMID:16403855\u0027, \u0027PMID:28106881\u0027]"}, {"betweenness_centrality": "445.2134482100284", "border-color": "#009bedff", "borderWidth": 1.5, "borderWidthSelected": 2, "category": "OrganismTaxon", "closeness_centrality": "0.21302900618164528", "color": {"background": "#7ad1ffff",
